import React from "react";

function ProfessionalLogin() {
  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h1>Professional Login</h1>
      <form>
        <input type="email" placeholder="Email" style={{ display: "block", margin: "10px auto", padding: "10px" }} />
        <input type="password" placeholder="Password" style={{ display: "block", margin: "10px auto", padding: "10px" }} />
        <button style={{ padding: "10px 20px" }}>Sign In</button>
      </form>
    </div>
  );
}

export default ProfessionalLogin;
